import React from 'react'
import Header from './Header';
import Home from './Home';
import { Routes, Route} from 'react-router-dom';


export default    function App() {
  return (
    <div className='App'>
        <div className='leftside'>
        <Header />
        </div>
        <div className='rightside'>
          <Routes>
            <Route>
            <Home />
            </Route>
          </Routes>
            
        </div>
      
       
    </div>
  );
}
